import React from "react";
import "../styles/Time.css";

const equipe = [
  {
    id: 1,
    nome: "Rodrigo Machado",
    cargo: "Co-Diretor Executivo",
    imagem: "/images/rodrigo.jpg",
  },
  {
    id: 2,
    nome: "Luis Otavio Ribeiro",
    cargo: "Co-Diretor Executivo",
    imagem: "/images/luis.jpg",
  },
];

const operacoes = [
  {
    id: 3,
    nome: "Renata Cybelle",
    cargo: "Analista de Suporte",
    imagem: "/images/renata.jpg",
  },
  {
    id: 4,
    nome: "Josiane Sá",
    cargo: "Analista de Administração",
    imagem: "/images/josiane.jpg",
  },
  {
    id: 5,
    nome: "Taynara Ferreira",
    cargo: "Analista de Finanças",
    imagem: "/images/taynara.jpg",
  },
  {
    id: 6,
    nome: "Fernanda Bandeira",
    cargo: "Gerente de Operações",
    imagem: "/images/fernanda.jpg",
  },
  {
    id: 7,
    nome: "Anna Rosa",
    cargo: "Estagiária de Segurança & Confiança",
    imagem: "/images/anna.jpg",
  },
  {
    id: 8,
    nome: "Rafael Cruz",
    cargo: "Analista de Suporte",
    imagem: "/images/rafael.jpg",
  },
];

const Time = () => {
  return (
    <div className="time-container">
      <h1>Nosso Time</h1>

      {/* Diretoria */}
      <div className="diretoria">
        {equipe.map((membro) => (
          <div key={membro.id} className="membro">
            <img src={membro.imagem} alt={membro.nome} />
            <h3>{membro.nome}</h3>
            <p>{membro.cargo}</p>
          </div>
        ))}
      </div>

      {/* Operações */}
      <h2>Operações</h2>
      <p>Garantimos que nossa operação esteja sempre rodando com tranquilidade</p>

      <div className="operacoes">
        {operacoes.map((membro) => (
          <div key={membro.id} className="membro">
            <img src={membro.imagem} alt={membro.nome} />
            <h3>{membro.nome}</h3>
            <p>{membro.cargo}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Time;
